function PublicAPIs() {
    const [apis, setApis] = useState([]);

    useEffect(() => {
        fetch('https://api.publicapis.org/entries')
            .then((response) => response.json())
            .then((data) => setApis(data.entries))
            .catch((error) => console.error('Error fetching APIs:', error));
    }, []);

    return (
        <div>
            <h1>Public APIs</h1>
            <ul>
                {apis.map((api, index) => (
                    <li key={index}>
                        <strong>{api.API}</strong>: {api.Description}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default PublicAPIs;
